@charset "UTF-8";


/*  reset  */
html,body,div,span,object,iframe,
h1,h2,h3,h4,h5,h6,p,blockquote,pre,
a,abbr,acronym,address,code,del,em,img,strong,
dl,dt,dd,ol,ul,li,
fieldset,form,label,
table,caption,tbody,tfoot,thead,tr,th,td {
	margin:0;
	padding:0;
	vertical-align:baseline;
	font-style:normal;
	font-weight:normal;
}
article,aside,figure,footer,header,small,nav,section {
	margin:0;
	padding:0;
	border:none;
	display:block;
	vertical-align:baseline;
	list-style:none;
	background-color:transparent;
	font-size:100%;
	outline:none;
}
h1,h2,h3,h4,h5,h6 {
	line-height:1.4;
	font-size:100%;
	font-weight:bold;
}
ul,ol {
	list-style-type:none;
}
dt,dd,li,
th,td,
input,
textarea {
	text-align:left;
	vertical-align:middle;
	line-height:1.3;
}
input,textarea,button {
	margin:0;
	padding:0;
	border:none;
	font-family:" ProN W3","HiraKakuProN-W3"," Pro W3","Hiragino Kaku Gothic Pro"," ","",Meiryo,"helvetica","arial",sans-serif;
	font-size:100%;
}
input[type="button"],input[type="text"],input[type="submit"],input[type="reset"],textarea {
   -webkit-appearance:none;
   border-radius:0;
}
button {
	background-color:transparent;
	cursor:pointer;
	outline:none;
}
table {
	border:none;
	border-collapse:collapse;
	border-spacing:0;
}
label {
	cursor:pointer;
}
hr {
	display:none;
}
img {
	line-height:1;
	vertical-align:baseline;
}
a img {
	border:none;
}
p {
	line-height:1.6;
}
strong,em {
	font-weight:bold;
}
a,
a:link {
	color:#fc5b5b;
	text-decoration:underline;
}
a:visited {
	color:#919090;
}
a:hover,
a:active {
	color:#fdadad;
}
a.al:hover img {
	opacity:0.7;
	filter: alpha(opacity=70);
	-ms-filter:"alpha(opacity=70)";
}
.pathH a,
.pathF a {
	color: #4c4c4c;
}
.pathH a:hover,
.pathF a:hover {
	text-decoration:none;
}

