/*  clearfix  */
.clearfix:after {
    content: "."; 
    display:block; 
    height:0; 
    clear:both; 
    visibility:hidden;
}
.clearfix {display:inline-block;}
* html .clearfix {height:1%;}
.clearfix {display:block;}


/*  html  */
html {
	overflow-y:scroll;
	height:100%;
}


/*  body  */
body {
	font-family:" ProN W3","HiraKakuProN-W3"," Pro W3","Hiragino Kaku Gothic Pro"," ","",Meiryo,"helvetica","arial",sans-serif;
	font-size:14px;
	color:#4c4c4c;
	background-color:#f7eed3;
	-webkit-text-size-adjust:100%;
	height:100%;
}

/* wrap */
#wrap {
     width: 100%;
     position: relative;
     height:auto !important; /*IE6*/
     height: 100%; /*IE6*/
     min-height: 100%;
}

/*  #header  */
#header {
	width:100%;
	min-width:1240px;
	background-color:#fff;
}
#header .headerInn {
	width:1240px;
	height:100px;
	/* background:url(../img/header_bg.gif) left top no-repeat; */
	position:relative;
	margin:0 auto;
}
#header .logo {
	position:absolute;
	left:18px;
	top:10px;
}
#header .logo img {
	width:86px;
}
#header .menuBtn {
	display:none;
}
#header .gnav {
	position:absolute;
	left:99px;
	top:55px;
}
#header .gnav li {
	float:left;
	margin-left:10px;
}
#header .snav {
	position:absolute;
	left:652px;
	top:10px;
}
#header .snav li {
	float:left;
	margin-left:18px;
}
#header .snsnav {
	position:absolute;
	left:1101px;
	top:0;
}
#header .snsnav p {
	line-height:1;
}
#header .snsnav li {
	float:left;
	margin-left:1px;
}
#header .snsnav li img {
	width:68px;
}

@media only screen and (min-width:1px) and (max-width:640px){
/*  #header  */
#header {
	width:100%;
	min-width:inherit;
	margin-bottom:12px;
}
#header .headerInn {
	width:100%;
	height:50px;
	background:none;
}
#header .logo {
	position:static;
	text-align:center;
	padding-top:2px;
}
#header .logo img {
	width:50px;
}
#header .menuBtn {
	display:block;
	position:absolute;
	right:0;
	top:5px;
}
#header .menuBtn img {
	width:40px;
}
#sidr {
	min-width:276px;
	background:url(../img/header_bg_sidr1.gif) left top repeat-y #f2efe6;
}
#sidr .sidrnav{
	min-width:276px;
	background:url(../img/header_bg_sidr2.gif) left top no-repeat;
}
#sidr .closeBtn {
	display:block;
	width:276px;
	height:50px;
	margin-bottom:6px;
}
#sidr .closeBtn a {
	display:block;
}
#sidr .closeBtn a img {
	width:276px;
}
#sidr .gnav li {
	margin-bottom:1px;
}
#sidr ul li a {
	display:block;
	color:#4c4c4c;
	font-size:15px;
	text-decoration:none;
}
#sidr .gnav li a {
	width:261px;
	height:50px;
	line-height:50px;
	font-weight:bold;
	padding-left:15px;
}
#sidr .snav {
	padding:9px 0 10px;
}
#sidr .snav li a {
	width:231px;
	height:38px;
	line-height:33px;
	padding-left:45px;
}
#sidr .snsnav {
	display:table;
}
#sidr .snsnav li {
	display:table-cell;
	padding-right:1px;
}
#sidr .snsnav .snsnav1 {
	width:165px;
}
#sidr .snsnav .snsnav1 a {
	width:150px;
	height:50px;
	line-height:50px;
	font-weight:bold;
	padding-left:15px;
}
#sidr .snsnav li img {
	width:54px;
}
.sidr{
	display:none;
	position:absolute;
	top:0;
	right:inherit;
	z-index:999999;
	width:276px;
	min-width:276px;
	height:100%;
	overflow-y:auto;
	overflow-x:hidden;
}
.sidr.right{
	right:-276px;
	left:auto;
}
.sidr ul{
	display:block;
}
}


/*  #contents  */
#contents {
	width:1240px;
	margin:0 auto;
	padding-bottom:138px; /**/
}

/*  .pathH  */
#contents .pathH{
	width:1240px;
	height:56px;
	margin:0 auto;
}
#contents .pathH p{
	font-size:12px;
	line-height:56px;
}

/*  .pathF  */
#contents .pathF{
	width:1240px;
	height:50px;
	margin:0 auto;
	clear:both;
}
#contents .pathF p{
	font-size:12px;
	line-height:50px;
}

/* close button */
.close {
	width:100%;
	text-align:center;
}

/*  .main  */
#contents .main {
	width:926px;
	float:right;
}
.main section {
	width:846px;
	border:1px solid #e4e0dd;
	margin-bottom:25px;
	padding:40px 40px 50px;
	background-color:#fff;
}
#contents .main.oneC {
	width:1240px;
	margin:20px auto;
	float:none;
}
.main.oneC section {
	width:auto;
	border:1px solid #e4e0dd;
	margin-bottom:0;
	padding:50px 40px 50px;
	background-color:#fff;
}
.main .sectionBorder {
	background:url(../img/section_border.gif) center top no-repeat #fff;
}
.main.oneC .sectionBorder {
	background:url(../img/section_border_oneC.gif) center top no-repeat #fff;
}

/*  .headline  */
.main .headline1{
	font-size:33px;
	font-weight:bold;
	margin-bottom:20px;
	line-height: 1.3;
}
.main .headline2{
	font-size:26px;
	font-weight:bold;
	border-left:5px solid #e70012;
	margin-bottom:20px;
	padding:5px 0 5px 12px;
	line-height:1.2;
}
.main .headline3{
	font-size:22px;
	font-weight:bold;
	color:#e70012;
	border-bottom:2px dashed #e6e6e6;
	padding-bottom:10px;
	margin-bottom:25px;
	line-height:1.4;
}
.main .headline4{
	font-size:16px;
	font-weight:bold;
	border-bottom:2px solid #e6e6e6;
	padding:0 0 5px 25px;
	margin-bottom:15px;
	line-height:1.4;
	background:url(../img/main_cir.png) left 2px no-repeat;
}
.main .headline5{
	font-size:14px;
	font-weight:bold;
	color:#e70012;
}
.main .headline6{
	font-size:22px;
	font-weight:bold;
	margin-bottom:20px;
	line-height:1.2;
}

/* stepNavi */
.main .stepNavi{
	width:100%;
	margin-bottom:20px;
}

/*  .catchtxt  */
.main .catchtxt1{
	font-size:18px;
	font-weight:bold;
	margin-bottom:15px;
	line-height:1.4;
}
.main .catchtxt1 span{
	font-size:14px;
	font-weight:normal;
}
.main .month{
	font-size:14px;
	font-weight:bold;
	width:100px;
	height:30px;
	line-height:30px;
	background-color:#e6e6e6;
	text-align:center;
}
.main .imgbor{
	border:1px solid #e6e6e6;
}

/*  link  */
.main a{
	color:#fc5b5b;
	text-decoration:underline;
}
.main .selflink,
.main .blanklink,
.main .pdflink,
.main .backlink {
	color:#fc5b5b;
}
.main .selflink a {
	background:url(../img/main_arrow3.png) right center no-repeat;
	padding-right:16px;
}
.main .blanklink a {
	background:url(../img/main_blank.png) right center no-repeat;
	padding-right:16px;
}
.main .pdflink a {
	background:url(../img/main_pdf.png) right center no-repeat;
	padding-right:16px;
}
.main .backlink a {
	background:url(../img/main_arrow4.png) left center no-repeat;
	padding-left:16px;
}
.main .selflink a:hover,
.main .blanklink a:hover,
.main .pdflink a:hover,
.main .backlink a:hover {
	text-decoration:none;
}
/*  .btntxt  */
.main .btntxt1,
.main .btntxt2,
.main .btntxt3,
.main .btntxt4,
.main .btntxt5,
.main .btntxt6,
.main .btnCity{
	font-size:16px;
	font-weight:bold;
	width:auto;
	height:45px;
	line-height:45px;
	text-align:center;
	background-color:#e06807;
}
.main .btntxt1:hover,
.main .btntxt2:hover,
.main .btntxt3:hover,
.main .btntxt4:hover,
.main .btntxt5:hover,
.main .btntxt6:hover,
.main .btnCity:hover{
	background-color:#e99551;
}
.main .btntxt2,
.main .btnCity{
	font-size:14px;
	width:180px;
	height:35px;
	line-height:35px;	
	margin:0 auto;
}
.main .btntxt2 input,
.main .btnCity input{
	border:none;
	background-color:transparent;
	width:180px;
	height:35px;
	line-height:35px;	
	margin:0 auto;	
}
.main .btntxt4{
	width:240px;
	margin:0 auto;
}
.main .btntxt5{
	font-size:14px;
	width:190px;
	height:35px;
	line-height:35px;
	margin:0 auto;
}
.main .btntxt6{
	font-size:14px;
	height:35px;
	line-height:35px;
}
.main .btntxt1 a,
.main .btntxt2 a,
.main .btntxt3 a,
.main .btntxt4 a,
.main .btntxt5 a,
.main .btntxt6 a{
	display:block;
	color:#fff;
	text-decoration:none;
	padding:0 30px;
}
 .main .btntxt2 input[value],
 .main .btnCity input[value]{
	display:block;
	color:#fff;
	text-decoration:none;
	padding:0;
	text-align:center;
}
.main .btntxt2 a,
.main .btntxt5 a{
	padding:0;
}
.main .btntxt1 a span,
.main .btntxt2 a span{
	background:url(../img/main_arrow1.png) right center no-repeat;
	padding-right:12px;
}
.main .btntxt2 input{
	background:url(../img/main_arrow1.png) no-repeat;
	padding-right:12px;
	background-position: 65% 50%;
}
.main .btnCity input{
	background:url(../img/main_arrow1.png) no-repeat;
	padding-right:12px;
	background-position: 75% 50%;
}
.main .btntxt3 a span{
	background:url(../img/main_cart2.png) right center no-repeat;
	padding-right:25px;
}
.main .btntxt4 a span{
	background:url(../img/main_search.png) right center no-repeat;
	padding-right:25px;
}
.main .btntxt5 a span{
	background:url(../img/main_blank2.png) right center no-repeat;
	padding-right:25px;
}
.main .btntxt6 a span{
	background:url(../img/main_more.png) right center no-repeat;
	padding-right:25px;
}

/*  .listStyle  */
.main .listStyle1 li {
	padding-left:15px;
	text-indent:-15px;
	margin-bottom:5px;
}
.main .listStyle1 li:before {
	content: "";
	color: #e70012;
	padding-right:5px;
	font-size:10px; 	
}
.main .listStyle2 {
	padding-left:20px;
}
.main .listStyle2 li {
	list-style:decimal outside;
	margin-bottom:5px;
}
.main .listStyle3 li {
	margin-bottom:5px;
}
.main .listStyle3 li:before {
	content: "";
	color: #e70012;
}

/*  .tab  */
.main .tab1,
.main .tab2{
	width:810px;
	border-bottom:9px solid #e70012;
	padding:0 18px;
}
.main .tab1 li,
.main .tab2 li{
	width:400px;
	height:50px;
	font-size:18px;
	font-weight:bold;
	line-height:50px;
	text-align:center;
	display:inline-block;
}
.main .tab2 li{
	width:263px;
}
.main .tab1 li a,
.main .tab2 li a{
	display:block;
	background-color:#e6e6e6;
	border-radius:3px 3px 0 0;
}
.main .tab1 li a:hover,
.main .tab1 li.active a,
.main .tab2 li a:hover,
.main .tab2 li.active a{
	display:block;
	background-color:#e70012;
	color:#fff;
	text-decoration:none;
}
.main .tab1 li a span,
.main .tab2 li a span{
	background:url(../img/main_arrow3.png) right center no-repeat;
	padding-right:16px;
}
.main .tab1 li a:hover span,
.main .tab2 li a:hover span{
	background:url(../img/main_arrow1.png) right center no-repeat;
}
.main .tab1 li.active a span,
.main .tab2 li.active a span{
	background:none;
	padding-right:0;
}

/*  .dita  */
.main .dita1,
.main .dita2,
.main .dita3{
	width:100%;
	display:table;
	border-left:1px dotted #e70012;
}
.main .dita3{
	border-left:none;
}
.main .dita1 li,
.main .dita2 li{
	display:table-cell;
	border-right:1px dotted #e70012;
	text-align:center;
	vertical-align:middle;
	padding:5px 0;
}
.main .dita2 li{
	width:25%;
}
.main .dita3 li{
	display:table-cell;
	width:33%;
	vertical-align:middle;
	padding:5px 0;
}
.main .dita1 li a,
.main .dita2 li a{
	font-size:18px;
	font-weight:bold;
	color:#e70012;
	text-decoration:none;
	background:url(../img/main_arrow2.png) right center no-repeat;
	padding-right:12px;
}
.main .dita1 li a:hover,
.main .dita2 li a:hover{
	color:#f9b2b6;
	background:url(../img/main_arrow2_on.png) right center no-repeat;
}

/*  .faq  */
.main .faqQ1,
.main .faqA1,
.main .faqQ2,
.main .faqA2{
	display:table;
	width:100%;
	margin-bottom:8px;
}
.main .faqA2{
	border-bottom:1px solid #e6e6e6;
	margin-bottom:20px;
	padding-bottom:20px;
}
.main .faqA2.nobo{
	border-bottom:none;
	margin-bottom:20px;
	padding-bottom:20px;
}
.main .faqQ1 dt,
.main .faqA1 dt,
.main .faqQ2 dt,
.main .faqA2 dt{
	background:url(../img/bg_q.gif) left top no-repeat;
	width:32px;
	height:32px;
	line-height:32px;
	text-align:center;
	font-size:16px;
